Twee broers besluiten uit geldnood een overval te plegen. Zorgvuldig voorbereid gaan ze ervan uit dat alles goed gaat. Geen 
geweld, geen doden en dus geen slachtoffers. Maar als een van hen zich niet aan afspraak houdt, valt het hele plan in het water 
en moet er haastig een nieuwe uitweg bedacht worden.
